import React from 'react';
import './App.css';
import Checkbox from 'rc-checkbox';
import 'rc-checkbox/assets/index.css';
import { useLocation } from "react-router-dom";
import { useNavigate } from "react-router";
import  { useEffect, useState } from "react";
import { StyledFrame10, Rectangle16, TitlePage3, UnderstandingRebatePercentagesFo, NTheRebatePercentageIsThePor, Arrow1, TitlePage4, Arrow2, Group39, ImDone, TitlePage, TitlePage2, SetARebatePercentage, NYouCanChangeThisLater, Group37, EnterStoreName, Group33, N5minimum, Titlepage, Group38, Address, Group34, Rectangle175, N75, Rectangle18, N10, Screenshot20231109At7281, SameAddressEnteredPreviously, Group35, Rectangle176, N125, Rectangle182, N15, Group36, Custom, Screenshot20240305At6411 } from "./onestore";

function MDash() {
    const location = useLocation();
    const history = useNavigate();
    const [link, setLink] = useState("");
    useEffect(() => {
        if (location.state) {
          setLink(location.state.link)
        } else {
          history("/signin");
        }
      }, [location.state]);
    console.log(link)
  return (
    <StyledFrame10>
      <Rectangle16>
        <TitlePage3>
          <UnderstandingRebatePercentagesFo>Understanding Rebate Percentages: For Merchants:</UnderstandingRebatePercentagesFo>
          <NTheRebatePercentageIsThePor> {"                                     "}The rebate percentage is the portion of a sale that is returned to the customer as a rebate or cashback. It&#39;s the percentage of the total purchase price that customers get back after making a purchase. For example, if the rebate percentage is 5% and a customer spends $100, they would receive $5 back as a rebate. Setting the rebate percentage effectively determines how much incentive you&#39;re offering customers to make purchases from your business. </NTheRebatePercentageIsThePor>
        </TitlePage3>
        <Arrow1 />
        <TitlePage4> {"    "}Here&#39;s the gist: Customers scan a QR code displayed by you, enter their bill amount (let&#39;s say $100), and pay in full. You receive the full payment, and with a click, send back 10% ($10) to the customer as a rebate, while 2% ($2) goes to us. Customers can track their savings and cash out to their bank accounts or apply it to property tax rebates. It&#39;s a win-win, boosting customer loyalty and streamlining the process for everyone involved.</TitlePage4>
        <Arrow2 />
        <Group39>
          <ImDone>IM DONE!</ImDone>
        </Group39>
      </Rectangle16>
      <TitlePage>Youâ€™re almost done...</TitlePage>
      <TitlePage2>
        <SetARebatePercentage>{`Set a rebate percentage:
`}</SetARebatePercentage>
        <NYouCanChangeThisLater>(You can change this later)</NYouCanChangeThisLater>
      </TitlePage2>
      <Group37>
        <EnterStoreName>Enter Store Name</EnterStoreName>
      </Group37>
      <Group33>
        <N5minimum>5% (MINIMUM)</N5minimum>
      </Group33>
      <Titlepage>Create your first store</Titlepage>
      <Group38>
        <Address>Address?</Address>
      </Group38>
      <Group34>
        <Rectangle175>
          <N75>7.5%</N75>
        </Rectangle175>
        <Rectangle18>
          <N10>10%</N10>
        </Rectangle18>
      </Group34>
      <Screenshot20231109At7281 backgroundImage={`https://assets.rapidream.com/project/93baa0b4-cfcc-40ab-ad81-37058e369265/assets/c4aca540-4b9c-4cd1-bb3e-6c0a7d5c193f.png`} />
      <SameAddressEnteredPreviously>Same Address entered previously</SameAddressEnteredPreviously>
      <Group35>
        <Rectangle176>
          <N125>12.5%</N125>
        </Rectangle176>
        <Rectangle182>
          <N15>15%</N15>
        </Rectangle182>
      </Group35>
      <Group36>
        <Custom>Custom</Custom>
      </Group36>
      <Screenshot20240305At6411 backgroundImage={`https://assets.rapidream.com/project/93baa0b4-cfcc-40ab-ad81-37058e369265/assets/b048e9e7-6f89-49ff-bf14-8ec4b5074ad3.png`} />
    </StyledFrame10>
  );
}

export default MDash;
